import logo from './logo.svg';
import './App.css';
import React, {
  Component
} from 'react'

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Frankenstein',
          id: 'abcd1'
        },
        {
          name: 'Dracula',
          id: 'xyz7'
        },
        {
          name: 'Zombie',
          id: 'lmno5'
        }
      ]
    }
  }

  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users')
    .then(response => console.log())
  }

  render() {
    return ( 
    <div className = "App" >
      {this.state.monsters.map(monster => (
        <h1 key={monster.id}>{monster.name}</h1>
      ))}
    </div>
    );
  }

}

export default App;
